module.exports=`<p></p><h1>1.登录平台</h1>用户登录<br>打开网址，输入用户名、密码，打开后，如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><p></p><h1>2.软件整体框架介绍</h1><h2>2.1人员定位介绍</h2><h3>2.1.1全部分站</h3>全部分站功能主要介绍了当前所在煤矿的全部分站各信息，主要包括序号、姓名、员工编号、部门、工种、职务等。如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><h3>2.1.2历史数据查询</h3>历史数据查询功能可查询该煤矿的历史信息，包括序号、姓名、员工编号、部门、工种、职务等。如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><h3>2.1.3人员定位报警</h3>人员定位报警功能可显示这一周的报警次数，以及哪个分站报警和报警人的姓名、序号、员工编号、部门、工种、职务等。如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><h2>2.2监测监控</h2><h3>2.2.1实时监测数据</h3>实时监测数据功能主要是监测显示当时该煤矿的传感器ID、位置、传感器类型、当前值、数据获取时间以及操作。如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><h3>2.2.2实时报警数据</h3>实时报警数据功能主要是显示当时报警的数据。如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><h3>2.2.3分类监测数据</h3>分类监测数据主要显示进行实时监测的数据类型：二氧化碳、风速、负压、甲烷、水位、温度、一氧化碳。<br><h2>2.3应急救援</h2><h2>2.4设备管理</h2><h3>2.4.1机电设备管理</h3>机电设备管理主要显示该煤矿的各机电设备的名称、位置、以及操作等，其中机电设备包括水泵、提升机、电动机、齿轮箱、电力变压器等。如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><h3>2.4.2井下电话管理</h3>井下电话管理主要显示该煤矿的安装的地下电话的ID、坐标、安装地点等。如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><h2>2.5避灾路径</h2><h2>2.6工具</h2><h2>2.7系统帮助</h2><h3>2.7.1快捷方式</h3><h3>2.7.2帮助</h3>帮助是主要帮助用户更好使用使用该平台，主要包括使用帮助说明和技术文档说明。<br><h2>2.8管理员</h2><h3>2.8.1账户中心</h3>账户中心主要是记录用户的个人信息和密码。<br><h3>2.8.2退出</h3>点击该按钮就可以退出。<br><h1>3图层管理页面</h1><h2>3.1地表建筑</h2>点击地表建筑会在屏幕上显示该地区的上的地表建筑。如下图所示：<p></p><p><img src="data:image/png;base64," style="max-width:100%;"><br></p><h2>3.2巷道</h2>点击巷道显示该地区的地下巷道系统。<br><h1>4主屏幕按键</h1><h2>4.1 搜索</h2>在搜索框中输入所要查询的地点，在主屏幕的地球上会直接显示所要查询的地区。<br><h2>4.2 home键</h2>点击home键能直接将地球恢复为全图模式。<br><h2>4.3 3D键</h2>点击3D键可以转换模式可以转换为3D和2D模式。<br><h2>4.4 帮助键</h2>点击可转换成鼠标模式和触屏模式。<br><p></p>`;